('ff68381f-1f75-4089-a574-fe49fc816501', 'Mặt bằng đẹp cho mở quán ăn, chuyển phát nhanh, văn phòng công ty.... đường vào sân bay', '0', 'BZS3', 'Địa chỉ: Đường Duy Tân, Phường Hòa Thuận Tây, Quận Hải Châu, Đà Nẵng', '696bdf69-4ba3-422f-a24b-1e10016d01cc', 'CTPT', '[\"Mặt bằng đẹp cho bán hàng ăn sáng trưa, chiều, tối, khuya. Văn phòng hoặc chuyển phát nhanh.Trên đường vào và gần sân bay, nơi có hàng nghìn người có nhu cầu ăn(vì trong sân bay quá đắt) gồm hành khách đi mb, nhân viên sân bay, taxi, grab...mùa covid vẫn bán cả trăm xuất. Mặt tiền có thể sử dụng 7,5m. Vỉa hè 6m. Giá 8tr/tháng, hợp đồng 1 năm, cọc 1 tháng, trả tiền hàng tháng. Lh a cường 0888880132.\"]', '266b24d8-3817-4303-ad13-2be0667d4be1', '68460b23-5767-4e28-8b6f-bb1824935b2d', 'f9c6643d-d72f-4b9c-809e-fd1ccbc3dfa0', '2023-04-10 07:40:08', '2023-04-10 07:40:08');
